Infinite load time for nodejs route<p>I have an asynchronous route at /api/dashboard the code is below:</p>
<pre><code>router.get(&quot;/&quot;, async (req, res, next) =&gt; {
  let userID
  try {
    const jwt = req.headers.authorisation.split(&quot; &quot;)[1];
    const { payload } = verifyToken(jwt, res);
    userID = payload?.id;
  } catch (err) {
    next(err)
  }

  let numberCompletedExams
  try {
    numberCompletedExams = await ExamResult.find()
    .then(examResults =&gt;
      // find the total number of completed exams belonging to a particular student
      examResults.reduce((acc, examResult) =&gt; {
        if (!matchesUser(examResult.userId, userID)) {
          return acc
        }
        return acc + 1
      },0)
    )
  } catch (err) {
    next(err)
  }

  let numberActiveExams
  try {
    numberActiveExams = await Exam.find()
      .then(exams =&gt;
        // find the total number of active exams belonging to a particular student
        exams.reduce((acc, exam) =&gt; {
          if (!notDue(exam.due)) return acc
          return acc + 1
        },0)
      )
  } catch (err) {
    next(err)
  }

  return {
    total: numberCompletedExams + numberActiveExams,
    active: numberActiveExams,
    completed: numberCompletedExams
  }
});
</code></pre>
<p>I know that the variables numberCompletedExams and numberActiveExams get resolved to their correct values since they log to the console but the function never returns ie. infintely loads when using postman at the route &quot;api/dashboard&quot;. How do I get the function to return?</p>

