indexing array in mongodb chat design<p>I want to design a simple chat in mongodb.</p>
<p>the conversation schema is like</p>
<pre><code>{
    conversation_id:  { type: ObjectId },
    time:  { type: Date },
    type: { type: String , enum:['direct','group']},
    members: [{ type: ObjectId }],
    total_messages:  { type: Number },
}
</code></pre>
<p>.</p>
<p>Usually there are two simple type of conversation, one is direct chat, another is group chat. In the direct chat, the number of members is 2 people while group member has more than 2 people.</p>
<p>For query a conversation of any user, using $in is ok</p>
<pre><code>    {
        conversation_id: 12345,
        time: time,
        members: ['user_id1', 'user_id2'],
        total_messages: 2
    }.

  let query = {
    &quot;members&quot;:{ $in: body.users } 
  };
</code></pre>
<p>I want to index the 'members' property in the direct mode in order to speed up the search; and in the group mode , I think it is ok not to index 'members' property in the group mode, since the group member may have ten to hundred people, indexing is too costly.</p>
<p>so my first question is how would I do the array indexing( only 2 elements in the direct chat) to make the search more efficiently.</p>
<p>second question is can I have the separate indexing depending the chat type, direct chat with array indexing and group chat without array indexing?</p>

