MongoDB Aggregate pipeline taking 10 minutes<p>I have two MongoDB collections: <code>players</code> and <code>stats</code>.</p>
<p><code>players</code> collection have some data I am interested in, and a field named <code>username</code> which is used to reference the <code>stats</code> collection through a field on <code>stats</code> called <code>username</code>.</p>
<p>I have the following aggregate pipeline to get the required data from <code>players</code> collection that have data on <code>stats</code> collection, as well as few other conditions.</p>
<pre><code>[{
        $match: {
            &quot;username&quot;: {
                $exists: true, $ne: null, $not: {
                    $regex: &quot;^\\s*$&quot;
                }
            }
        }
    }, {
        $lookup: {
            from: &quot;stats&quot;,
            localField: &quot;username&quot;,
            foreignField: &quot;username&quot;,
            as: &quot;stats&quot;
        }
    }, {
        $match: {
            stats: {
                $ne: []
            }
        }
    }, {
        $count: &quot;count&quot;
    }]
</code></pre>
<p>The problem I am facing is that this does not work on big datasets. When I ran this aggregate pipeline on a dataset of 54K documents in the <code>players</code> collection and 15k in the <code>stats</code> collection, it takes around 10 minutes to execute which is far from ideal.</p>
<p>What would be a possible enhancements to achieve this task on bigger datasets without taking such a long time?</p>
<p>Things I have also considered, I have tried to do a reverse lookup (from <code>stats</code> collection and lookup on <code>players</code>), but that did not help. I also tried several pipeline stage modifications (project, pipeline within the match stage, grouping, count) but nothing helped.</p>
<p>EDIT</p>
<p>I have tried indexing fields &quot;username&quot; on both collections and that helped to get it down from 10 minutes to 20-25 seconds, but I would like to bring it down more, what other suggestions would be?</p>

